import React from 'react'
import {View, Text, TouchableOpacity, StyleSheet} from 'react-native'

export function ButtonRecuperar () {
    return(
        <TouchableOpacity
            style = {{
                ...styles.button,
                backgroundColor: '#0a0a0a'
            }}
            >
            <Text
                style = {{
                    color: ''
                }}
            >
                Black Button
            </Text>
        </TouchableOpacity>
    )
}

const styles = StyleSheet.create({
    button: {
        alignSelf: 'center',
        borderRadius: 10,
        width: '100%',
        marginVertical: 10,
        paddingVertical: 2,
    }
})
